transforms.result:
@use '~/assets/styles/_variables.scss' as variables;

.add-info {
  position: fixed;
  top: 0;
  bottom: 0;
  right: 0;
  left: 0;
  background-color: rgba(0, 0, 0, 0.8);
  z-index: 1000;
  display: flex;
  align-items: center;
  justify-content: center;
}

.add-info__modal {
  width: 400px;
  background-color: variables.$color-white;
  position: relative;
  z-index: 1100;
  padding-top: 25px;
  padding-bottom: 25px;
  border-radius: 15px;
  border: 1px solid #979797;
  overflow: hidden;
}

.add-info__modal_mobile {
  width: 100%;
  border: 1px solid transparent;
  border-radius: 0;
  height: 100%;
}

.add-info__back-icon {
  height: 25px;
  position: absolute;
  top: 25px;
  left: 10px;
  cursor: pointer;
}

.add-info__title {
  font-size: 20px;
  font-weight: 400;
  color: variables.$color-black;
  margin-bottom: 25px;
  padding-left: 25px;
  padding-right: 25px;
}

.add-info__title_mobile {
  padding-left: 45px;
}

.menu__active {
  font-size: 12px;
  font-weight: 400;
  color: variables.$color-dark-grey;
  margin-bottom: 0px;
  text-align: center;
}

.menu__name {
  margin-bottom: 5px;
  text-align: center;
  font-size: 21px;
  font-weight: 400;
  text-decoration: underline;
  color: variables.$color-active;
}

.menu__title {
  margin-bottom: 5px;
  text-align: center;
  font-size: 21px;
  font-weight: 400;
  color: variables.$color-black;
}

.menu__position {
  margin-bottom: 5px;
  font-size: 12px;
  font-weight: 400;
  text-align: center;
  color: variables.$color-dark-grey;
}

.menu__participants {
  margin-bottom: 5px;
  font-size: 12px;
  font-weight: 400;
  text-align: center;
  color: variables.$color-dark-grey;
}

.add-info__img {
  margin: 0 auto 10px;
}

.add-info__close-icon {
  position: absolute;
  top: 15px;
  right: 15px;
  cursor: pointer;
  transition: 0.3s all;
}

.add-info__close-icon:hover {
  scale: 1.1;
}

.menu__item {
  padding: 10px 25px 10px 25px;
  cursor: pointer;
  font-size: 16px;
  font-weight: 400;
  color: variables.$color-dark;
  display: flex;
  gap: 10px;
}

.menu__item_last {
  padding: 10px 25px 20px 25px;
}

.menu__item-icon {
  border-radius: 5px;
  background-color: #0584fe;
  width: 18px;
  height: 18px;
  margin: 1px;
  display: flex;
  justify-content: center;
  align-items: center;
}

.menu__item-icon_not-selected {
  background-color: transparent;
  border: 1px solid #0584fe;
}

.menu__item-img {
  transform: scale(0.7);
  color: #fff;
}

.menu__item_active {
  background-color: variables.$color-light-grey;
}

.menu__item:nth-of-type(1) {
  border-radius: 7px 7px 0 0;
}

.details-menu__item {
  padding: 10px 25px;
  background-color: #f7f8fa;
  cursor: pointer;
  font-size: 16px;
  font-weight: 400;
  color: variables.$color-dark;
  display: flex;
  gap: 10px;
  align-items: flex-start;
  transition: 0.2s all;
}

.details-menu__item:not(:last-of-type):hover {
  scale: 1.03;
}

.details-menu__item_first {
  padding-top: 20px;
}

.details-menu__item_pre-last {
  padding-bottom: 20px;
}

.details-menu__item_last {
  padding-top: 20px;
  padding-bottom: 0;
  color: variables.$color-red;
  background-color: variables.$color-white;
}
